import React from "react";
import styles from "./Nasa.module.css";

const Nasa = () => {
  return (
    <section className={styles.section}>
      <div className={styles.container}>
        <h1 className={styles.title}>BreatheSafetyIndex`s key offerings:</h1>
        <div className={styles.textImageWrapper}>
          <div className={styles.divider}></div>{" "}
          <p className={styles.aboutText}>
            High quality of environmental dataThe integration of air quality
            data from various sources (including space-based monitoring programs
            (ESA and NASA/ TEMPO) expands the capabilities to provide
            high-resolution hourly pollutant data.Comprehensive outdoor
            environment hazards assessmentsOur system evaluates risk levels for
            respiratory, cardiovascular, immune, and other systems based on live
            air quality data, giving an all-encompassing view of pollution’s
            impact on health.Simple API integrationEasily integrate our
            JSON-based API into your weather services, smart city platforms,
            health apps, or public health management systems. The user-friendly
            format ensures seamless access to our extensive data, helping you
            deliver reliable, real-time information on air quality risks to your
            users.
          </p>
          <img src="./Nasa.png" alt="Фото" className={styles.image} />
        </div>
      </div>
    </section>
  );
};

export default Nasa;
